import { Component } from 'react';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

class DeleteObject extends Component {
    constructor(props) {
        super(props)
        this.state = {
            objectKind: this.props.objectKind,
            objectName: this.props.objectName,

            httpMethod: 'DELETE',
            modalOpen: false,
        };
    }

    handleSubmit = () => {
        this.setState({ modalOpen: false });
        this.props.handleSendRequest(JSON.stringify({name: this.state.objectName}), this.state.httpMethod)
    };

    handleClickOpen = () => {
        this.setState({ modalOpen: true });
    };

    handleClickClose = () => {
        this.setState({ modalOpen: false });
    };

    render() {
        return (
            <div>
                <Button variant="outlined" onClick={this.handleClickOpen} size={"large"}>
                    Delete {this.state.objectName}
                </Button>

                <Dialog
                    open={this.state.modalOpen}
                    onClose={this.handleClickClose}
                    aria-labelledby="alert-dialog-title"
                    aria-describedby="alert-dialog-description"
                >
                    <DialogTitle id="alert-dialog-title">
                        Do you want to Delete {this.state.objectName}?
                    </DialogTitle>
                    <DialogContent>
                        <DialogContentText id="alert-dialog-description">
                            This will Delete {this.state.objectName} from Kubernetes Cluster.
                        </DialogContentText>
                    </DialogContent>
                    <DialogActions>
                        <Button onClick={this.handleClickClose}>No</Button>
                        <Button onClick={this.handleSubmit} autoFocus>Yes</Button>
                    </DialogActions>
                </Dialog>
            </div>
        )
    }
}

export default DeleteObject
